ing_is_regular\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"0\";}}}s:18:\"field_meeting_abbr\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:4:\"MWBP\";s:6:\"format\";N;s:10:\"safe_value\";s:4:\"MWBP\";}}}s:30:\"field_meeting_search_meta_date\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:61:\"Meeting with bullet points MWBP Byrådssalen Ebeltoft Byradet\";}}}s:23:\"field_ref_bullet_points\";a:1:{s:3:\"und\";a:3:{i:0;a:1:{s:9:\"target_id\";s:1:\"6\";}i:1;a:1:{s:9:\"target_id\";s:1:\"7\";}i:2;a:1:{s:9:\"target_id\";s:2:\"21\";}}}}',0,1336568585,1),('field:node:6','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1753:\"Sagsfremstilling\r\n\r\nLokalplan området\r\n\r\nLokalplan området er beliggende i Ebeltoft, Vibæk Strandvej 4-8 og omfatter et område på ca. 1,9 ha. Mod vest grænser området direkte op til Vibæk Strandvej og Campingpladsen Vibæk. Mod øst grænser lokalplan området op til Vibæk Skovvej og Nordsøruten. Mod nord ligger et eksisterende boligområde ved Grævlingevej.\r\n\r\nOmrådet ligger i byzone og anvendelsen er hotel, benzintank, sommerhusudlejning, bowlingcenter og autoværksted. Området er omfattet af to kommuneplanrammer, som udlægger området til hhv. tæt-lav boligområde og lokalcenter til lokalområdets forsyning. Den trafikale forsyning til området sker primært fra Vibæk Strandvej og sekundært fra Vibæk Skovvej.\r\n\r\nLokalplanens formål\r\n\r\nBaggrunden for lokalplanen er et konkret ønske om at etablere en dagligvarebutik med en maks. butiksstørrelse på 1.000 m2. Lokalplan 361 skaber rammerne for etablering af et mindre centerområde til dagligvareforsyning. \r\n\r\nDetailhandelsanalyse\r\n\r\nSom baggrund for lokalplanen er der udarbejdet en detailhandelsanalyse for at afklare, hvilke konsekvenser placering af en dagligvarebutik vil have for handelen i Ebeltoft bymidte. Analysen, udarbejdet på foranledning af Syddjurs Kommune af Retail Institute Scandinavia viste, at det ikke ville få væsentlig indflydelse på handelen i midtbyen, såfremt der kun placeres dagligvarebutikker indenfor centerområdet. Det har derfor været nødvendigt at inddrage store dele af lokalplan 266, da der i denne lokalplan er mulighed for at etablere 600 m2 til butiksformål. På baggrund af denne detailhandelsanalyse valgte Udvalget for Plan, udvikling og kultur den 15. marts 2010 at igangsætte arbejdet med at udarbejde lokalplan 361.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:1789:\"<p>Sagsfremstilling</p>\n<p>Lokalplan området</p>\n<p>Lokalplan området er beliggende i Ebeltoft, Vibæk Strandvej 4-8 og omfatter et område på ca. 1,9 ha. Mod vest grænser området direkte op til Vibæk Strandvej og Campingpladsen Vibæk. Mod øst grænser lokalplan området op til Vibæk Skovvej og Nordsøruten. Mod nord ligger et eksisterende boligområde ved Grævlingevej.</p>\n<p>Området ligger i byzone og anvendelsen er hotel, benzintank, sommerhusudlejning, bowlingcenter og autoværksted. Området er omfattet af to kommuneplanrammer, som udlægger området til hhv. tæt-lav boligområde og lokalcenter til lokalområdets forsyning. Den trafikale forsyning til området sker primært fra Vibæk Strandvej og sekundært fra Vibæk Skovvej.</p>\n<p>Lokalplanens formål</p>\n<p>Baggrunden for lokalplanen er et konkret ønske om at etablere en dagligvarebutik med en maks. butiksstørrelse på 1.000 m2. Lokalplan 361 skaber rammerne for etablering af et mindre centerområde til dagligvareforsyning. </p>\n<p>Detailhandelsanalyse</p>\n<p>Som baggrund for lokalplanen er der udarbejdet en detailhandelsanalyse for at afklare, hvilke konsekvenser placering af en dagligvarebutik vil have for handelen i Ebeltoft bymidte. Analysen, udarbejdet på foranledning af Syddjurs Kommune af Retail Institute Scandinavia viste, at det ikke ville få væsentlig indflydelse på handelen i midtbyen, såfremt der kun placeres dagligvarebutikker indenfor centerområdet. Det har derfor været nødvendigt at inddrage store dele af lokalplan 266, da der i denne lokalplan er mulighed for at etablere 600 m2 til butiksformål. På baggrund af denne detailhandelsanalyse valgte Udvalget for Plan, udvikling og kultur den 15. marts 2010 at igangsætte arbejdet med at udarbejde lokalplan 361.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:20:\"field_ref_attachment\";a:1:{s:3:\"und\";a:3:{i:0;a:1:{s:9:\"target_id\";s:1:\"8\";}i:1;a:1:{s:9:\"target_id\";s:2:\"10\";}i:2;a:1:{s:9:\"target_id\";s:2:\"11\";}}}s:22:\"field_bul_point_closed\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"1\";}}}}',0,1336569121,1),('field:node:7','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2524:\"Udvalget for Plan, udvikling og kultur besluttede i møde den 27. oktober 2011 at igangsætte plangrundlaget for et sundhedshus, bypark og boligområde med dertil tilpasset infrastruktur, placeret mellem Energivej og Knebel Bygade og omfattende matrikel nr. 8f, 8g, og 8t Knebel By, Knebel.\r\n\r\nIgangsætning af planlægningen sker på baggrund af en henvendelse fra Borgerforeningen Mols, Distriktsråd for Mols og Helgenæs, da sundhedshuset, byparken og stiforbindelserne udgør en væsentlig del af projekt ”Fremtidens landsby”, hvortil der er givet tilsagn om støtte af Region Midtjylland og Syddjurs Kommune. Lokalplanen er underlagt et tidspres, da det samlede projekt ”Fremtidens Landsby” skal være gennemført og de midler, der er givet tilsagn om, skal være forbrugt inden den 22. november 2012.\r\n\r\nEn forudsætning for lokalplanens realisering er, at der kan indgås mageskifte med ejendommen matr. nr. 8g, Knebel By, Knebel, hvor sundhedshuset tænkes placeret. Statsforvaltningen kan ikke tage stilling til et evt. mageskifte før der foreligger en endelig godkendt lokalplan.\r\n\r\nByrådet godkendte i møde den 27. oktober 2011 købet af ejendommen Knebel Bygade 30 og 30B med henblik på at skabe en forbindelse mellem Knebel Bygade, sundhedshuset og byparken. Indsatspuljen har reserveret midler til nedrivningen af burgeren, og Økonomiudvalget behandlede i møde den 22. december 2011 et evt. videresalg af beboelsesejendommen. \r\n\r\nBorgerforeningen Mols har tilkendegivet, at de ikke anser realiseringen af et Sundhedshus på matr. 8g i Knebel By for muligt, uden at både burgeren og beboelsesbygningen fjernes. \r\n\r\nBeboelsesbygningen er opført i år 1911 og er registreret med en middel bevaringsværdi. Bygningen fremstår udvendig lidt forsømt, men den er ikke kondemnabel, og indgår som del af den sammenhængende bebyggelse langs med Knebel Bygade. På denne baggrund anbefales det, at bygningen bevares og planafdelingen har tidligere vurderet, at det vil være muligt at etablere et sundhedshus med god sammenhæng til Knebel Bygade uden nedrivning af bygningen.\r\n\r\nDer er nu udarbejdet et forslag til en lokalplan, der viser sammenhængen mellem sundhedshuset og Knebel Bygade, ligesom der er udarbejdet før og efter visualiseringer af Sundhedshuset, som det kan se ud set fra Knebel Bygade.\r\n\r\nBeslutningen om evt. frasalg af beboelsesejendommen Knebel Bygade 30 bør træffes i forbindelse med lokalplanforslagets godkendelse, idet dette er afgørende for lokalplanens afgrænsning.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:2560:\"<p>Udvalget for Plan, udvikling og kultur besluttede i møde den 27. oktober 2011 at igangsætte plangrundlaget for et sundhedshus, bypark og boligområde med dertil tilpasset infrastruktur, placeret mellem Energivej og Knebel Bygade og omfattende matrikel nr. 8f, 8g, og 8t Knebel By, Knebel.</p>\n<p>Igangsætning af planlægningen sker på baggrund af en henvendelse fra Borgerforeningen Mols, Distriktsråd for Mols og Helgenæs, da sundhedshuset, byparken og stiforbindelserne udgør en væsentlig del af projekt ”Fremtidens landsby”, hvortil der er givet tilsagn om støtte af Region Midtjylland og Syddjurs Kommune. Lokalplanen er underlagt et tidspres, da det samlede projekt ”Fremtidens Landsby” skal være gennemført og de midler, der er givet tilsagn om, skal være forbrugt inden den 22. november 2012.</p>\n<p>En forudsætning for lokalplanens realisering er, at der kan indgås mageskifte med ejendommen matr. nr. 8g, Knebel By, Knebel, hvor sundhedshuset tænkes placeret. Statsforvaltningen kan ikke tage stilling til et evt. mageskifte før der foreligger en endelig godkendt lokalplan.</p>\n<p>Byrådet godkendte i møde den 27. oktober 2011 købet af ejendommen Knebel Bygade 30 og 30B med henblik på at skabe en forbindelse mellem Knebel Bygade, sundhedshuset og byparken. Indsatspuljen har reserveret midler til nedrivningen af burgeren, og Økonomiudvalget behandlede i møde den 22. december 2011 et evt. videresalg af beboelsesejendommen. </p>\n<p>Borgerforeningen Mols har tilkendegivet, at de ikke anser realiseringen af et Sundhedshus på matr. 8g i Knebel By for muligt, uden at både burgeren og beboelsesbygningen fjernes. </p>\n<p>Beboelsesbygningen er opført i år 1911 og er registreret med en middel bevaringsværdi. Bygningen fremstår udvendig lidt forsømt, men den er ikke kondemnabel, og indgår som del af den sammenhængende bebyggelse langs med Knebel Bygade. På denne baggrund anbefales det, at bygningen bevares og planafdelingen har tidligere vurderet, at det vil være muligt at etablere et sundhedshus med god sammenhæng til Knebel Bygade uden nedrivning af bygningen.</p>\n<p>Der er nu udarbejdet et forslag til en lokalplan, der viser sammenhængen mellem sundhedshuset og Knebel Bygade, ligesom der er udarbejdet før og efter visualiseringer af Sundhedshuset, som det kan se ud set fra Knebel Bygade.</p>\n<p>Beslutningen om evt. frasalg af beboelsesejendommen Knebel Bygade 30 bør træffes i forbindelse med lokalplanforslagets godkendelse, idet dette er afgørende for lokalplanens afgrænsning.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:20:\"field_ref_attachment\";a:0:{}s:22:\"field_bul_point_closed\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:1:\"0\";}}}}',0,1336570703,1),('field:node:8','a:1:{s:14:\"field_bpa_body\";a:1:{s:3:\"und\";