INSERT INTO `field_data_body` VALUES ('node','bullet_point',0,6,6,'und',0,'Sagsfremstilling\r\n\r\nLokalplan området\r\n\r\nLokalplan området er beliggende i Ebeltoft, Vibæk Strandvej 4-8 og omfatter et område på ca. 1,9 ha. Mod vest grænser området direkte op til Vibæk Strandvej og Campingpladsen Vibæk. Mod øst grænser lokalplan området op til Vibæk Skovvej og Nordsøruten. Mod nord ligger et eksisterende boligområde ved Grævlingevej.\r\n\r\nOmrådet ligger i byzone og anvendelsen er hotel, benzintank, sommerhusudlejning, bowlingcenter og autoværksted. Området er omfattet af to kommuneplanrammer, som udlægger området til hhv. tæt-lav boligområde og lokalcenter til lokalområdets forsyning. Den trafikale forsyning til området sker primært fra Vibæk Strandvej og sekundært fra Vibæk Skovvej.\r\n\r\nLokalplanens formål\r\n\r\nBaggrunden for lokalplanen er et konkret ønske om at etablere en dagligvarebutik med en maks. butiksstørrelse på 1.000 m2. Lokalplan 361 skaber rammerne for etablering af et mindre centerområde til dagligvareforsyning. \r\n\r\nDetailhandelsanalyse\r\n\r\nSom baggrund for lokalplanen er der udarbejdet en detailhandelsanalyse for at afklare, hvilke konsekvenser placering af en dagligvarebutik vil have for handelen i Ebeltoft bymidte. Analysen, udarbejdet på foranledning af Syddjurs Kommune af Retail Institute Scandinavia viste, at det ikke ville få væsentlig indflydelse på handelen i midtbyen, såfremt der kun placeres dagligvarebutikker indenfor centerområdet. Det har derfor været nødvendigt at inddrage store dele af lokalplan 266, da der i denne lokalplan er mulighed for at etablere 600 m2 til butiksformål. På baggrund af denne detailhandelsanalyse valgte Udvalget for Plan, udvikling og kultur den 15. marts 2010 at igangsætte arbejdet med at udarbejde lokalplan 361.','','filtered_html'),('node','bullet_point',0,7,7,'und',0,'Udvalget for Plan, udvikling og kultur besluttede i møde den 27. oktober 2011 at igangsætte plangrundlaget for et sundhedshus, bypark og boligområde med dertil tilpasset infrastruktur, placeret mellem Energivej og Knebel Bygade og omfattende matrikel nr. 8f, 8g, og 8t Knebel By, Knebel.\r\n\r\nIgangsætning af planlægningen sker på baggrund af en henvendelse fra Borgerforeningen Mols, Distriktsråd for Mols og Helgenæs, da sundhedshuset, byparken og stiforbindelserne udgør en væsentlig del af projekt ”Fremtidens landsby”, hvortil der er givet tilsagn om støtte af Region Midtjylland og Syddjurs Kommune. Lokalplanen er underlagt et tidspres, da det samlede projekt ”Fremtidens Landsby” skal være gennemført og de midler, der er givet tilsagn om, skal være forbrugt inden den 22. november 2012.\r\n\r\nEn forudsætning for lokalplanens realisering er, at der kan indgås mageskifte med ejendommen matr. nr. 8g, Knebel By, Knebel, hvor sundhedshuset tænkes placeret. Statsforvaltningen kan ikke tage stilling til et evt. mageskifte før der foreligger en endelig godkendt lokalplan.\r\n\r\nByrådet godkendte i møde den 27. oktober 2011 købet af ejendommen Knebel Bygade 30 og 30B med henblik på at skabe en forbindelse mellem Knebel Bygade, sundhedshuset og byparken. Indsatspuljen har reserveret midler til nedrivningen af burgeren, og Økonomiudvalget behandlede i møde den 22. december 2011 et evt. videresalg af beboelsesejendommen. \r\n\r\nBorgerforeningen Mols har tilkendegivet, at de ikke anser realiseringen af et Sundhedshus på matr. 8g i Knebel By for muligt, uden at både burgeren og beboelsesbygningen fjernes. \r\n\r\nBeboelsesbygningen er opført i år 1911 og er registreret med en middel bevaringsværdi. Bygningen fremstår udvendig lidt forsømt, men den er ikke kondemnabel, og indgår som del af den sammenhængende bebyggelse langs med Knebel Bygade. På denne baggrund anbefales det, at bygningen bevares og planafdelingen har tidligere vurderet, at det vil være muligt at etablere et sundhedshus med god sammenhæng til Knebel Bygade uden nedrivning af bygningen.\r\n\r\nDer er nu udarbejdet et forslag til en lokalplan, der viser sammenhængen mellem sundhedshuset og Knebel Bygade, ligesom der er udarbejdet før og efter visualiseringer af Sundhedshuset, som det kan se ud set fra Knebel Bygade.\r\n\r\nBeslutningen om evt. frasalg af beboelsesejendommen Knebel Bygade 30 bør træffes i forbindelse med lokalplanforslagets godkendelse, idet dette er afgørende for lokalplanens afgrænsning.','','filtered_html'),('node','bullet_point',0,21,21,'und',0,'no attachments','','filtered_html'),('node','speaker_paper',0,24,24,'und',0,'tests rrrrrrrrr','','filtered_html'),('node','speaker_paper',0,25,25,'und',0,'the speaker paper text','','filtered_html');
